import React, { useContext, useEffect } from 'react';
import { Link, useParams } from 'react-router-dom';
import { observer } from 'mobx-react-lite';
import { Context } from '../../storage';
import classes from './ProfilePageSideBar.module.css'; // CSS

const ProfilePageSideBar = observer(() => {
    const { friendStore, groupStore, userStore } = useContext(Context);
    const { id: profileId } = useParams();

    const isMyProfile = !profileId || (userStore.user && userStore.user.id === Number(profileId));
    const targetUserId = isMyProfile ? userStore.userId : Number(profileId);

    useEffect(() => {
        if (targetUserId) {
            // Загружаем друзей и группы для отображаемого профиля
            // Для своего профиля friendStore.fetchMyFriends()
            // Для чужого friendStore.fetchUserFriends(targetUserId)
            if (isMyProfile) {
                friendStore.fetchMyFriends();
            } else {
                friendStore.fetchUserFriends(targetUserId);
            }
            // Группы пользователя (если UserResponseDto не включает их)
            // groupStore.fetchUserGroups(targetUserId); // или 'me'
            // Если UserResponseDto УЖЕ содержит user.groups, то используем их
        }
    }, [targetUserId, isMyProfile, friendStore, groupStore]);

    const profileData = isMyProfile ? userStore.user : userStore.currentProfile;
    const friends = isMyProfile ? friendStore.myFriends : friendStore.userFriends;
    // Группы берутся из DTO пользователя, если они там есть
    const groups = profileData?.groups || []; // Предполагаем, что UserResponseDto.groups это List<UserGroupDto>
                                              // UserGroupDto содержит group: GroupMinimalResponseDto

    // Лимит отображения
    const friendsLimit = 6;
    const groupsLimit = 6;

    return (
        <div className={classes.mainContainer}>
            <div className={classes.container}>
                <h2 className={classes.title}>Friends ({friends.length})</h2>
                <div className={classes.items}>
                    {friends.length > 0 ? friends.slice(0, friendsLimit).map((friend) => (
                        <div className={classes.item} key={`friend-${friend.id}`}>
                            <div className={classes.avatarContainer}>
                                <Link to={`/users/${friend.id}`}>
                                    <img src={friend.avatarUrl || '/default-avatar.png'} alt="avatar" className={classes.avatar}/>
                                </Link>
                            </div>
                            <div className={classes.linkContainer}>
                                <Link to={`/users/${friend.id}`} className={classes.link}>
                                    {`${friend.firstName} ${friend.lastName}`}
                                </Link>
                            </div>
                        </div>
                    )) : (<div>No friends to show.</div>)}
                </div>
                {friends.length > friendsLimit && (
                    <Link to={isMyProfile ? ROUTE.FRIENDS_MY : `/users/${targetUserId}/friends`} className={classes.seeAllLink}>
                        See all friends
                    </Link>
                )}
            </div>

            <div className={classes.container}>
                <h2 className={classes.title}>Groups ({groups.length})</h2>
                <div className={classes.items}>
                    {groups.length > 0 ? groups.slice(0, groupsLimit).map((userGroup) => (
                        <div className={classes.item} key={`group-${userGroup.group.id}`}>
                            <div className={classes.avatarContainer}>
                                 <Link to={`/groups/${userGroup.group.id}`}>
                                    <img src={userGroup.group.imageUrl || '/default-group-avatar.png'} alt="group avatar" className={classes.avatar}/>
                                </Link>
                            </div>
                            <div className={classes.linkContainer}>
                                <Link to={`/groups/${userGroup.group.id}`} className={classes.link}>
                                    {userGroup.group.name}
                                </Link>
                                <span className={classes.roleInGroup}>{userGroup.role}</span>
                            </div>
                        </div>
                    )) : (<div>Not a member of any group.</div>)}
                </div>
                {/* Ссылку "See all groups" можно добавить, если есть отдельная страница для групп пользователя */}
            </div>
        </div>
    );
});

export default ProfilePageSideBar;
